                <Link href="/nosotros">Nosotros</Link>
                
            </li>
        </ul>

    <style jsx>
    {
        `ul{
            background-color:#333;
            list-style:none;
            display:flex;
        }
        
        `



}
    
    
    </style>

    </div>

)

export default Navegacion
